import React from 'react';
import { IButtonProps } from '../types/types';

const Button = (props: IButtonProps) => {
    const {
        buttonText,
    } = props
    return (
        <>
            <button className='button'><h3>{buttonText}</h3></button>
        </>
    )
}

export default Button;
